import Header from "./components/Header"
import Footer from "./components/Footer"

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          title: 'Мотоцикл Minsk CX 650',
          img: 'Мотоцикл_Minsk_CX_650.jpg',
          desc: 'Мотоцикл Minsk CX 650 (или Minsk X-Ride 650) является современной интерпретацией классического байка.',
          category: 'motorbike',
          price: '15 000.00'
        }
      ]
    }
  }
  render() {
  return (
    <div className="wrapper">
      <Header />
      <Footer />
    </div>
  )
  }
}

export default App;
